import React, { useEffect, useState } from 'react';
import api from '../services/api';

export default function TenantLeaseCard({ userId }) {
  const [lease, setLease] = useState(null);

  useEffect(() => {
    api.get(`/leases/user/${userId}`)
      .then(res => setLease(res.data))
      .catch(() => setLease({ error: true }));
  }, [userId]);

  if (!lease) return <p>Loading lease info...</p>;
  if (lease.error) return <p>Lease not found.</p>;

  return (
    <div style={cardStyle}>
      <h3>Lease Details</h3>
      <p><strong>Unit:</strong> {lease.unit_name}</p>
      <p><strong>Start:</strong> {lease.start_date}</p>
      <p><strong>End:</strong> {lease.end_date}</p>
      <p><strong>Rent:</strong> ${lease.monthly_rent}</p>
      <p><strong>Status:</strong> {lease.status}</p>
    </div>
  );
}

const cardStyle = {
  backgroundColor: '#fff',
  padding: '1.5rem',
  borderRadius: '10px',
  boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
  marginBottom: '2rem',
  fontFamily: 'Segoe UI, sans-serif'
};
